import React from "react";

function Card(props){
    return(
        <div>
            <div class="card" >
                <div class="card-body">
                <h5 class="card-title">{props.name}</h5>
                <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
            
                </div>
            </div>
        </div>
    )
}

export default Card;
